  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Hawaii at Manoa, School
  of Ocean and Earth Science and Technology (SOEST) dredge repository is under the
  Department of Geology and Geophysics, the core repository is under the Department
  of Oceanography.  SOEST is a partner in the Index to Marine and Lacustrine Geological
  Samples (IMLGS) database. As a partner repository, SOEST sends dredge data and information
  related to the SOEST sample collection to NCEI for long-term archive, and for discoverability
  via the IMLGS.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
